import React from "react";
import "./MainMenu.css";

const MainMenu: React.FC = () => {
    return (
    <div className="Menu">
        <header>
            <h1>
                ГЕРОЙ
            </h1>
            <h2>
                МОНЕТКИ
            </h2>
            <h3>
                ЭНЕРГИЯ
            </h3>
            <h4>
                МОНЕТКИ
            </h4>
            <h5>
                ГЕРОЙ
            </h5>
            <h6>
                МОНЕТКИ
            </h6>
        </header>
    </div>
);
};

export default MainMenu;
